		const response = await fetch(url);
		const result = await response.json();
        setGame(result);
    };

	useEffect(() => {
		getGameData();
    });

    return (
        <div>
            <h2>9ijakids Game List</h2>
            <input type="search"/>
            {games.map(game => (

<Body title={game.GameTitle} image={game.GameImage} description={game.GameDescription}/>
